@nina and I have grown our @FreshVineWine business with the belief that we need to have a vision and go for it, but be flexible and malleable because you never know what's going to happen—and that's where the magic happens. 🌟 

All I can say is wow have I learned a lot about myself over the past months and new industry. Coming from the world of dance and performing arts, building  #FVW has opened me up to a whole new meaning of flexibility!
#entrepreneurship 🍷
